import React, { Component } from 'react';

import { Table, Grid, Row, Col} from 'react-bootstrap';

export default class list extends Component {


    state = {
        prod:[
            {"id":1,"name":"Confort","cost":10000},
            {"id":2,"name":"Tallarines","cost":7000},
            {"id":3,"name":"Arroz","cost":4000},
            {"id":4,"name":"Mantequilla","cost":2000},
            {"id":5,"name":"Hamburguesa","cost":100},
            {"id":6,"name":"Mayonesa","cost":50000},
            {"id":7,"name":"Ketchup","cost":60000},
            {"id":8,"name":"Detergente","cost":70000},
            {"id":9,"name":"Pañales","cost":80000},
            {"id":10,"name":"Servilleta","cost":12000}
        ],
        cnt:1
    }

    buildList(){
        return this.state.prod.map((prod) => {
            return (
                <Item  key = {prod.id} it = {this.state.cnt++} code = {prod.id} name = {prod.name} cost = {prod.cost}/>
            )


        })
    }


    render() {
        return (

            <div className = "list">

                <div className = "container-fluid">
                    <Grid>
                        <Row className = "show-grid">
                            <Col lg = {1} md = {1}></Col>
                            <Col lg = {10} md = {10}>
                                <h2 style = {{marginBottom: 20 + 'px'}}>Listado de alumnos</h2>
                                <Table striped bordered condensed hover>
                                    <thead>
                                    <tr>
                                        <th className = "datos" >#</th>
                                        <th className = "datos" >Nombre</th>
                                        <th className = "datos" >Mail</th>
                                        <th className = "datos" >Correo</th>
                                    </tr>
                                    </thead>
                                    <tbody className = "datos">

                                    </tbody>
                                </Table>;
                            </Col>
                            <Col lg = {1} md = {1}></Col>
                        </Row>
                    </Grid>
                </div>
            </div>
        );
    }
}
